import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
    return (
        <div>
            <header className="fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
                <nav className="f6 fw6 ttu tracked">
                    <Link className="link dim black dib mr3" to="/" title="Home">Home</Link>
                    <Link className="link dim black dib mr3" to="/about" title="About">About</Link>
                    <Link className="link dim black dib mr3" to="/store" title="Store">Store</Link>
                    <Link className="link dim black dib" to="/contact" title="Contact">Contact</Link>
                </nav>
            </header>
        </div>
    );
}

export default Home;
